"use strict";(self.webpackChunkhandbook=self.webpackChunkhandbook||[]).push([[920],{3908:e=>{e.exports=JSON.parse('{"label":"guide","permalink":"/docs/tags/guide","allTagsPath":"/docs/tags","count":2,"items":[{"id":"learning/project management/pm-guide","title":"A Guide to Project Management","description":"A project is a temporary endeavor undertaken to create a unique product, service, or result. It is a set of coordinated and controlled activities with a beginning and an end, designed to achieve specific goals and objectives. Projects are typically used to achieve business goals and objectives, such as increasing revenue, improving efficiency, or developing new products or services.","permalink":"/docs/learning/project management/pm-guide"},{"id":"playbook/guidingprinciples","title":"Guiding Principles","description":"Why? To help align our culture and team to some core principles on how we actively do things here at Axioned. These go above and beyond our core values - and focus more on how we (individually and collectively) go about our days.","permalink":"/docs/playbook/guidingprinciples"}]}')}}]);